import React from "react";
import { Parallax } from 'react-scroll-parallax';
import './Logo.scss';

function Logo() {
    return (
        <div className="logo-div">
            <svg width="100vw" height="100vh">
                <rect width="100%" height="100%" style={{ fill: "#231F20" }} />
            </svg>
        </div>
    );
}

export default Logo;
